// src/App.jsx
import React from "react";
import './index.css';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
// import NotFound from "./pages/NotFound";
import Navbar from "./components/Navbar";
import Dashboard from "./components/Dashboard";
import AssignDriverForm from "./components/AssignDriverForm";
import ExpenseLogger from "./components/ExpenseLogger"; // ✅ Correct spelling
import InvoiceGenerator from "./components/InvoiceGenerator";
import TripPlanner from "./components/TripPlanner";
import VehicleForm from "./components/VehicleForm";

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/assign-driver" element={<AssignDriverForm />} />
        <Route path="/log-expense" element={<ExpenseLogger />} />
        <Route path="/generate-invoice" element={<InvoiceGenerator />} />
        <Route path="/plan-trip" element={<TripPlanner />} />
        <Route path="/add-vehicle" element={<VehicleForm />} />
        {/* <Route path="*" element={<NotFound />} /> */}
      </Routes>
    </Router>
  );
};

export default App;
